.module-category .module-category__content > .module-category__description {
    max-width: 575px;
    margin: 0 auto;
}

.module-category-child-wrap {
    margin-top: 20px;
    padding: 20px;
    border-radius: 12px;
    position: relative;
    background: #FFFFFF;
    -webkit-backdrop-filter: blur(10px);
    border: 1px solid #F5F5F5;
    overflow: hidden;
}

.module-category-child-wrap > * {
  position: relative;
  z-index: 1;
}

.module-category-item .module-category-item__description ul {
    --columns: 1;
    padding-left: 20px;
}

.module-category-child-wrap:not(:last-child) {
    margin-bottom: 20px;
}

@media(max-width: 768px) {
    ul {
        padding-left: 20px;
    }
    .module-category-item .module-category-item__description ul {
    --columns: 1;
    }
}

